import React from 'react';
import Sidebar from './Sidebar';
import '../css/app.css';
import Mainpage from './Mainpage';
import { Router } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="main">
        <div className="plan">
          <Sidebar></Sidebar>
          <Mainpage></Mainpage>
        </div>
      </div>
    </Router>
  );
}

export default App;
